import React from 'react';
import logo from './logo.svg';
import './App.css';

function App() {
  const fetchData = async (startHour, endHour) => {
    try {
      var datePrefix = new Date().toISOString().substring(0, 11);
      var startTime = '2020-07-30T15:00:00.0000000';
      var endTime = '2020-07-30T23:59:00.0000000';
      // TODO: Get current time to identify start and end work hours
      let getCalendarEventsUrl = "https://graph.microsoft.com/v1.0/me/calendarView?startDateTime=" + startTime + "&endDateTime=" + endTime + "&$select=subject,start,end";

      // TODO: Call Login API to fetch Auth Token

      const options = {
        headers: {
        "Authorization": "eyJ0eXAiOiJKV1QiLCJub25jZSI6IlR1M2JoV242NVRNTDlzcVNnX0d2UkV0Z0Rrdkd3MElEdWNiUVZ1RW9ueFEiLCJhbGciOiJSUzI1NiIsIng1dCI6Imh1Tjk1SXZQZmVocTM0R3pCRFoxR1hHaXJuTSIsImtpZCI6Imh1Tjk1SXZQZmVocTM0R3pCRFoxR1hHaXJuTSJ9..jD5dpnSDTb0pGS4O51P6Y8vzCyA_MGqBanjkG3RXAC3wl0Dq9_0JEeNsmrm-Zudc4tdmZqGQXrNBNE8vbSxohT6Lwhenlaq3tpo_SEjsUklufmjcueAoZ0j8iCo6_uPt8zMk0IDpsikUwTZvPJgLySLi5t6Z91EmwX51G4uNBANh6NavmEEcPn8povEIroLgiPsKDs45w5Tr29JP7fEXxrjtklnujMveStCP9HHtm6yQax1k7So0MOwUOOzVgKvHoecmLZgQ5OajhQ7YR_CThFOiSJ3nSiSXsxKJsFs4WGwv2duCgyCMLidVziV_UzCIYF0o61b3Tfv73Z_uU3aWtw" //Paste Token from Graph Explorer Access Token tab until the generating auth token part is plugged in
        }
      };

      // Fetching user's calendar data for today
      var response = await fetch(getCalendarEventsUrl, options);
      if(response.status >= 300) {
        throw new Error(response.statusText);
      }

      var body = await response.json();
      var events = body.value;

      let startTimes = [];
      let endTimes = [];
      let i = 0;
      events.forEach(element => {
        startTimes[i] = element.start.dateTime;
        endTimes[i] = element.end.dateTime;
        console.log(element.subject + " : " + startTimes[i] + " to " + endTimes[i]);
        i++;
      });

      let maxDiff = new Date(startTimes[0]) - new Date(startTime);

      let interval = 0;
      let j;
      for(j=1; j<startTimes.length; j++) {
        var diff = new Date(startTimes[j]) - new Date(endTimes[j-1]);
        console.log(diff + " : " + maxDiff);
        if(diff > maxDiff) {
          maxDiff = diff;
          interval = j;
        }
      }

      console.log(maxDiff);
      console.log(new Date(endTimes[j-1]).getHours());
      var activityStartTime = (interval === 0 ? 15 : new Date(endTimes[j-1]).getHours()) + 1;
      console.log("Active time start: " + interval + " : " + activityStartTime);

      // TODO: Scheduling algorithm to indentify free times from the calendar
    } catch (error) {
      console.log("Error in fetching calendar data: " + error.message);
    }
  }
    
  const createEvent = async () => {
    try {
      let addEventUrl = "https://graph.microsoft.com/v1.0/me/events";

      // TODO: Call Login API to fetch Auth Token

      const options = {
        method: "POST",
        body: JSON.stringify(
          {  
            subject: "Some Activity",
            start: {
              dateTime: "2020-07-27T17:00:00.000",
              timeZone: "Pacific Standard Time"
            },
            end: {
              dateTime: "2020-07-27T17:30:00.000",
              timeZone: "Pacific Standard Time"
            },
            responseRequested: true,
            allowNewTimeProposals: true
          }
        ),
        headers: {
          "Content-type": "application/json",
          "Authorization": "eyJ0eXAiOiJKV1QiLCJub25jZSI6IkVpa2l4UmZiUjhfc1pZN0s4ellEWXRaSGstbEFIRHVwMEd1ZzNFOHpneFUiLCJhbGciOiJSUzI1NiIsIng1dCI6Imh1Tjk1SXZQZmVocTM0R3pCRFoxR1hHaXJuTSIsImtpZCI6Imh1Tjk1SXZQZmVocTM0R3pCRFoxR1hHaXJuTSJ9..vJHo2iu0Oa4vjnk2VxaztkySgnVE2qW7GHvh0KRGy53PI63pwYtIiC69z5meU6d-z1QBE7w_3u95oaIEOJyTxcoUIP7zUoOeHPQabQFEZuO7DOTsuxBmJRPP1q9EVZM-buTWtSvAm-I5IxGL04eraWaZItA17Uvdl4PjZgVeAHC4nirAptafEQmmhAOzFr-94HR_oX9MGcrb3MBcuqMZbcCX9lZ5GcxjaofXc73fc-txJF0L8MP98npc-39vA07MdDv2zJ1ba4iIPCOc7fe9UPcd24o12j44Mag4fb_8emAAxMhF_i65emAg0ZlxXvu2D1XPPrmCXGvJDNV0mavwSg" //Paste Token from Graph Explorer Access Token tab until the generating auth token part is plugged in
        }
      };

      // TODO: Create calendar event for an identified free time
      var response = await fetch(addEventUrl, options);
      console.log(response);
      if(response.status >= 300) {
        throw new Error(response.statusText);
      }
    } catch (error) {
      console.log("Error in creating calendar event: " + error.message);
    }
  }

  return (
    <div className="App">
      <header className="App-header">
        {/* <img src={logo} className="App-logo" alt="logo" />
        <p>
          Edit <code>src/App.js</code> and save to reload.
        </p> */}
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
        <div>
          <button id="fetch" onClick={fetchData}>
            Fetch My Calendar Data
          </button>
          <br/>
          <button id="create" onClick={createEvent}>
            Create an Event in my Calendar
          </button>
        </div>
      </header>
    </div>
  );
}

export default App;
